CREATE TABLE IF NOT EXISTS "musteri_communication" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "date" datetime NOT NULL, "method" varchar(100) NOT NULL, "details" text NOT NULL);
CREATE TABLE IF NOT EXISTS "musteri_customer_communication_history" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "customer_id" bigint NOT NULL REFERENCES "musteri_customer" ("id") DEFERRABLE INITIALLY DEFERRED, "communication_id" bigint NOT NULL REFERENCES "musteri_communication" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "musteri_expense" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "age" integer unsigned NOT NULL CHECK ("age" >= 0), "country" varchar(2) NOT NULL, "contract_fee" bool NOT NULL, "population_fee" bool NOT NULL, "card_fee" bool NOT NULL);
CREATE TABLE IF NOT EXISTS "musteri_expenseitem" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(200) NOT NULL, "amount" decimal NOT NULL);
CREATE TABLE IF NOT EXISTS "musteri_country" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(200) NOT NULL, "fee_first_year" decimal NOT NULL, "fee_next_year" decimal NOT NULL);
