CREATE TABLE IF NOT EXISTS "musteri_customer" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "first_name" varchar(30) NOT NULL, "last_name" varchar(30) NOT NULL, "passport_info" varchar(100) NULL, "service_type" varchar(100) NOT NULL, "payment_made" decimal NULL, "phone_number" varchar(15) NULL, "ptt_code" varchar(50) NULL, "residence_permit_end_date" date NULL, "residence_permit_start_date" date NULL, "notes" text NULL, "application_number" varchar(50) NULL, "application_type" varchar(30) NULL, "date_of_birth" date NULL, "identity_number" varchar(11) NULL, "issuing_authority" varchar(100) NULL, "marital_status" varchar(30) NULL, "nationality" varchar(30) NULL, "passport_date" varchar(100) NULL, "passport_number" varchar(30) NULL, "residence_type" varchar(30) NULL, "mail" varchar(50) NULL);
CREATE TABLE IF NOT EXISTS "musteri_customerfile" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "uploaded_file" varchar(100) NOT NULL, "file_description" varchar(255) NOT NULL, "customer_id" bigint NOT NULL REFERENCES "musteri_customer" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "musteri_yapilacak" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "yapilacak" varchar(255) NOT NULL, "detay" text NULL, "olusturulma_tarihi" datetime NOT NULL, "tamamlandi" bool NOT NULL, "tamamlanma_tarihi" datetime NULL);
